package yolobe.test.eugenio;

/**
 * @author EugenioMoreno
 *
 */
public class Network {
	private int id;
	private String name;
	/**
	 *  
	 * @param id of the network
	 * @param name of the network
	 */
	public Network(int id, String name) {
		// TODO Auto-generated constructor stub
		this.id=id;
		this.name=name;
	}
	//Getter
	public int getId() {
		return id;
	}
	public String getName() {
		return name;
	}

}
